Explain why this algorithm works.def binary_search(list, target):
  lower = 0 
  upper = len(list) - 1

  while lower <= upper: 
    mid = (lower + upper) // 2  # Floor Division
    guess = list[mid]
    if guess == target:
      return mid
    if guess > target:
      upper = mid - 1
    else: 
      lower = mid + 1

  return None

